#jqtrapp {
    font-family: Helvetica, Arial, sans-serif;
    font-size: 14px;
    min-height: 400px;
    overflow-wrap: normal;
    position: relative;
    white-space: normal;
    word-break: break-word;
    word-wrap: normal;

    div {
        outline: none;
        white-space: inherit;
    }

    h2 {
        font-size: 22px;
    }

    a {
        text-decoration: none;
    }

    .bold {
        font-weight: 700;
    }

    .red {
        color: red;
    }

    .warning-symbol {
        cursor: default;
        display: flex;
        flex-direction: column;
        font-size: 28px;
        justify-content: center;
        text-align: center;
    }

    .error {
        border-radius: 4px;
        border: 2px solid red;
        font-size: 18px;
        margin: 30px auto;
        padding: 20px;
        text-align: center;
        &.warning {
            border-color: #ffd500;
        }
        .error-type {
            text-transform: uppercase;
        }
        .error-list {
            margin: 0 auto;
            max-width: 1200px;
            text-align: left;
        }
    }

    .messageContainer {
        margin: 2rem auto;
        text-align: center;
    }

    input[type="text"] {
        box-sizing: border-box;
        color: darkslategrey;
        font-size: 22px;
        height: 50px;
        margin: 8px auto;
        padding: 4px 8px;
        text-overflow: clip;
        width: 100%;
    }

    span.initiative {
        align-items: center;
        display: flex;
        span { margin: 0 6px; min-width: fit-content; }
    }

    .status {
        display: flex;
        flex-direction: column;
        height: 100%;
        justify-content: center;
        min-height: 40px;
        padding-right: 12px;
        position: relative;
        width: 100%;

        .iconRow {
            align-items: center;
            display: flex;
            flex-direction: column;
            position: absolute;
            right: 0px;
            top: 0px;
        }
    }
    .hasTeam {
        color: #adadad;
    }
    .keyTask {
        font-size: 8px;
    }

    .viewSelector {
        display: flex;
        flex-direction: column;
        justify-content: space-between;
        min-height: 65px;
        div {
            border: 1px outset #ddd;
            cursor: pointer;
            display: flex;
            flex-direction: column;
            height: 26px;
            justify-content: center;
            pointer-events: all;
            position: relative;
        }
        div.active { 
            background-color: #efefef;
            border-style: inset;
            cursor: default;
        }
        div.initiative:before { content: 'ðŸ’¡' }
        div.assignee:before { content: 'ðŸ‘·' }
    }

    .time {
        display: flex;
        flex-direction: column;
        height: 100%;
        justify-content: center;
        text-align: center;
    }

    .expandedEnabled {
        border: 1px outset #ddd;
        display: flex;
        flex-direction: column;
        height: 26px;
        justify-content: center;
        pointer-events: all;
        position: relative;
        width: 26px;
        &.expandedIndex {
            background-color: #efefef;
            border-style: inset;
        }
    }

    .closedIndex {
        min-width: 24px;
    }

    .daysInStatus {
        font-size: 12px;
    }

    .toolTable {
        max-width: 220px;
        p {
            margin-bottom: 16px;
        }
        table {
            border-collapse: collapse;
            width: 100%;
            td {
                padding: 2px;
            }
            td:nth-child(2) {
                text-align: right;
            }
            span {
                background-color: rgb(180, 180, 180);
                border-radius: 50px;
                color: rgb(32, 32, 32);
                opacity: 1;
                padding: 2px 6px;
                text-align: right;
            }
            .good {
                background-color: rgb(45, 190, 90);
                color: white;
            }
            .bad {
                background-color: rgb(200, 50, 20);
                color: white;
            }
        }
    }

    // React-Table Overrides
    .rt-resizable-header-content {
        font-weight: 700;
    }

    .rt-tfoot {
        .rt-tr:hover {
            background: #fff;
        }
        .rt-td {
            font-weight: 700;
        }
    }

    .rt-td {
        display: flex;
        flex-direction: column;
        justify-content: center;
    }

    .rt-tr:hover {
        background-color: rgba(255, 244, 95, 0.2);
    }

    .ReactTable .rt-table {
        overflow: inherit;
    }

    .rt-thead.-header {
        background: #fff;
        position: sticky;
        top: 0;
        z-index: 10;
        &:hover .rt-tr {
            background: rgba(255, 255, 255, 0);
        }
        .rt-th {
            display: flex;
            flex-direction: column;
            justify-content: center;
        }
    }

    .subtable {
        border-bottom: 1px solid #656565;
        border-left: 0;
        border-right: 1px solid #656565;
        border-top: 0;
        .rt-thead.-header {
            z-index: 1;
        }
    }

    /* https://stephanwagner.me/only-css-loading-spinner */
    .loader:before {
        content: '';
        box-sizing: border-box;
        position: absolute;
        top: 40%;
        left: 50%;
        width: 60px;
        height: 60px;
        margin-top: -15px;
        margin-left: -15px;
        border-radius: 50%;
        border: 6px solid #ccc;
        border-top-color: #07d;
        animation: spinner .8s linear infinite;
    }
}

.progress {
    background: #adadad;
    border-radius: 50px;
    display: flex;
    justify-content: center;
    max-height: 10px;
    min-height: 10px;
    position: relative;
    text-align: center;
    div {
        background: #656565;
        border-radius: 50px;
        left:0;
        max-height: 10px;
        min-height: 10px;
        position: absolute;
        top: 0;
        z-index: 1;
    }
    span {
        color: #fff;
        font-size: 8px;
        min-width: 20px;
        padding: 0 4px;
        position: relative;
        z-index: 2;
    }
}

 .lineLoader {
  height: 17px;
  width: 100%;
  position: relative;
  overflow: hidden;
  background-color: #ddd;
}
.lineLoader:before{
  display: block;
  position: absolute;
  content: "";
  left: -200px;
  width: 200px;
  height: 17px;
  background-color: #2980b9;
  animation: lineLoading 2s linear infinite;
}

@keyframes lineLoading {
    from {left: -200px; width: 30%;}
    50% {width: 30%;}
    70% {width: 70%;}
    80% { left: 50%;}
    95% {left: 120%;}
    to {left: 100%;}
}

@keyframes spinner {
    to {
        transform: rotate(360deg);
    }
}
